    [],nt"num_tags": 7,nt"name": "national-bison-range-refuge-narrative-report-january-1-to-april-30-1955",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for National Bison
    Range outlines Refuge accomplishments from January through April of 1955. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, and raptors- is also covered. The Refuge development
    and maintenance section discusses physical developments and plantings. A progress
    report on field investigations and applied research is also provided. The public
    relations section of the report describes recreational uses, Refuge visitors, and
    Refuge participation. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
